import React from 'react';
import { useTooltip } from './TooltipContext';

const Tooltip = ({ text, children }) => {
  const { currentTooltip, openTooltip, closeTooltip } = useTooltip();

  return (
    <div onMouseEnter={() => openTooltip(text)} onMouseLeave={closeTooltip}>
      {children}
      {currentTooltip === text && (
        <div className="tooltip">
          <p>{currentTooltip}</p>
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```

